const Footer = () => {
  return (
    <section className='Footer' id='Footer'>
       <footer className='FooterSection'>

          <a href="#Intro"><button><span className='UpArrowKey'>&#8593;</span> GO TOP <span className='UpArrowKey'>&#8593;</span></button></a>
       </footer>
    </section>
  )
}

export default Footer;
